K('bridgedResource[Leads]').load({
  attributes: ['First Name', 'Last Name','id'],
  values: {},
  success: function(bridgedData) {
    var options=[{'value':'NEW_LEAD','label':'NEW LEAD'}];
    $.each( bridgedData, function( key, value ) {
	    console.log(value['id']+"-"+value['First Name']+" "+value['Last Name']);
			options[options.length]={'label':value['First Name']+" "+value['Last Name'], 'value':value['id']};
		});
    var label=null;
		K('field[Leads]').options(options);
    if (GetURLParameter("id")!==null) {
    	K('field[Leads]').value(GetURLParameter("id"));
      $(K('field[Leads]').options()).each(function(index) {
       if (K('field[Leads]').options()[index].value===GetURLParameter("id")) label=K('field[Leads]').options()[index].label;
      });      
    }
    bundle.config.widgets.selectMenu({
      element: K("form").find("#selectLeadMenu")[0],
      options: K('field[Leads]').options(),
      onChange: function(option) {
        K('field[Leads]').value(option.value);
        setTimeout(function(){
          $(K("form").find("#selectLeadMenu .css-1492t68")).html(option.label);
        },100);
      },
      value: K('field[Leads]').value(),
    });
    if (label!==null){
    	$(K("form").find("#selectLeadMenu div")[3]).html(label);
    }
  }
});

